import React from 'react'

const BoxSisu2 = (props) => {
    const style = {
        backgroundColor: props.on ? "red" : "green"
    }


    return (
        <div
            style={style}
            onClick={() => props.vajuta(props.id)}
        >
            <p>
                {props.weather ? (
                    <div>
                        {props.weather.hourly.time.map((item, index) => ({
                            id: index, // or any unique identifier for the item
                            name: item
                        })).map(({ id, name }) => (
                            <div key={id}>
                                <p>{name}</p>

                            </div>
                        ))}
                    </div>
                ) : (<p>No data!</p>)
                }
            </p>
            {props.id}
        </div>
    );
}

export default BoxSisu2
